    false,nt"url": null,nt"notes": "Imagery acquired with airborne sensors
    contain camera and terrain related distortions which make the images unsuitable
    for geospatial analysis as positions within the image may be significantly inaccurate.
    A digital orthophoto is a georeferenced image prepared from aerial imagery, or other
    remotely-sensed data in which the displacement within the image due to sensor orientation
    and terrain relief has been removed. Orthophotos combine the image characteristics
    of an image with the geometric qualities of a map. Orthoimages show ground features
    such as roads, buildings, and streams in their proper positions, without the distortion
    characteristic of unrectified aerial imagery. Digital Orthoimages produced and used
    within the Forest Service are developed from imagery acquired through various national
    and regional image acquisition programs. The resulting orthoimages, also known as
    orthomaps, can be directly applied in remote sensing, GIS and mapping applications.
    They serve a variety of purposes, from interim maps to field Standards for Digital
    Orthophotos references for earth science investigations and analysis. Because of
    the orthographic property, an orthoimage can be used like a map for measurement
    of distances, angles, and areas with scale being constant everywhere. Also they
    can be used as map layers in GIS or other computer based manipulation, overlaying,
    and analysis. An orthoimage differs from a map in a manner of depiction of detail;
    On the map only selected detail is shown by conventional symbols, whereas on an
    orthoimage all details appear just as in original aerial imagery.",nt"owner_org":
